    formData.append('file',file);
    let result =  fetch("http://127.0.0.1:5000/file-upload",{
      method:'POST',
      body:formData,
      headers:headers
    });
    alert("Data has been uploaded")
  }
  return(
    <div>
      <input type="file"
      onChange={(e)=>setFile(e.target.files[0])}></input>
